import styled from 'styled-components';

export const Container = styled.div`
        position: absolute;
        background: #FFFFFF;
        border-radius: 16px;
        width: 50vw;
`

export const Card = styled.div`
    width: 18vh;
    height: 50px;
    border: 1px solid red;
    margin-bottom: 50px;
`

export const Card2 = styled.div`
    width: 18vh;
    height: 50px;
    margin-bottom: 30vh;
    margin-top: 30vh;
    border: 1rem;
    border: 1px solid red;
`
